import "./App.css";

const App = () => {
  return (
    <div>
      <Header />
      <Technologies />
    </div>
  );
};
const Technologies = () => {
  return (
    <div>
      <ul>
        <li>html</li>
        <li>css</li>
        <li>js</li>
      </ul>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <a href="#"> Home my</a>
      <a href="#"> News Feed</a>
      <a href="#"> Massage</a>
    </div>
  );
};

export default App;
